import React from 'react';
import { useState, useEffect, useRef } from 'react';

import Button from '@mui/material/Button'

const data = {name: "Asdf", money: 3000, hehe: 10}


function Test_one() {
    const d_o = useRef(data);
    const [d_s, s_d_s] = useState(data);


    return (
        <>
            <Button onClick={() => {console.log(d_o);
                console.log(d_s);
            }}>hoho</Button>

            <Button onClick={() => {s_d_s({...d_s, money: 1000})}}>Change</Button>
        </>
    );
}

export default Test_one;
